/**
 * Statistics from an index build operation.
 */
public struct FfiBuildStats {
    /**
     * Number of files scanned.
     */
    public var filesScanned: UInt32
    /**
     * Number of Markdown files indexed for search.
     */
    public var markdownIndexed: UInt32
    /**
     * Number of metadata entries updated.
     */
    public var metadataUpdated: UInt32

    // Default memberwise initializers are never public by default, so we
    // declare one manually.
    public init(
        /**
         * Number of files scanned.
         */filesScanned: UInt32, 
        /**
         * Number of Markdown files indexed for search.
         */markdownIndexed: UInt32, 
        /**
         * Number of metadata entries updated.
         */metadataUpdated: UInt32) {
        self.filesScanned = filesScanned
        self.markdownIndexed = markdownIndexed
        self.metadataUpdated = metadataUpdated
    }
}



extension FfiBuildStats: Equatable, Hashable {
    public static func ==(lhs: FfiBuildStats, rhs: FfiBuildStats) -> Bool {
        if lhs.filesScanned != rhs.filesScanned {
            return false
        }
        if lhs.markdownIndexed != rhs.markdownIndexed {
            return false
        }
        if lhs.metadataUpdated != rhs.metadataUpdated {
            return false
        }
        return true
    }

    public func hash(into hasher: inout Hasher) {
        hasher.combine(filesScanned)
        hasher.combine(markdownIndexed)
        hasher.combine(metadataUpdated)
    }
}


